import React from 'react';

const Bottom = () =>{
    return(
        <>
<section className="w3l-bottom py-5">
    <div className="container py-md-4 py-3 text-center">
      <div className="header-section text-center mx-auto">
        <h3 className="hny-title">We Help Build On Past & Prepare<br/> For Your Future. </h3>
        <p className="my-3 px-lg-5"> Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae;
          Nulla mollis dapibus nunc, ut rhoncus
          turpis sodales quis. Integer sit amet mattis quam.Integer sit amet mattis quam.</p>
      </div>
      <div className="buttons mt-5">
        <a href="about.html" className="btn btn-style btn-primary mr-2">Read More</a>
        <a href="contact.html" className="btn btn-style btn-secondary ml-2">Get a quote</a>
      </div>
    </div>
    
  </section>

    </>
        
    );
}
export default Bottom;
